<?php
namespace LeetCode\Q1209;
use PHPUnit\Framework\TestCase;

class Q1209_RemoveAllAdjacentDuplicatesInStringII_Test extends TestCase
{
    /**
     * @var Solution
     */
    private $solution;

    public function setUp()
    {
        $this->solution = new Solution();
    }

    public function testSample1()
    {
        $s = "abcd"; $k = 2;
        $response = $this->solution->removeDuplicates($s, $k);
        var_dump($response);
        $this->assertEquals("abcd", $response);
    }

    public function testSample2()
    {
        $s = "deeedbbcccbdaa"; $k = 3;
        $response = $this->solution->removeDuplicates($s, $k);
        var_dump($response);
        $this->assertEquals("aa", $response);
    }

    public function testSample3()
    {
        $s = "pbbcggttciiippooaais"; $k = 2;
        $response = $this->solution->removeDuplicates($s, $k);
        var_dump($response);
        $this->assertEquals("ps", $response);
    }

    public function test_TLE1()
    {
        $s = "";
        $k = 10000;
        $response = $this->solution->removeDuplicates($s, $k);
        var_dump($response);
        $this->assertEquals("", $response);
    }
}


class Solution
{
    /**
     * @param String $s
     * @param Integer $k
     * @return String
     */
    function removeDuplicates($s, $k)
    {
        $stack = [];
        $len = strlen($s);

        $diff_offset = $i = 0;
        while ($i < $len) {
            array_push($stack, $s[$i]);
            if ((count($stack) - $diff_offset) >= $k) {
                for ($j=$k-1; $j>0; $j--) {
                    $shift = count($stack) - $k;
                    if ($stack[$j+$shift] != $stack[$j-1+$shift]) {
                        $diff_offset = $j + $shift;
                        break;
                    }
                }

                if ($j == 0) {
                    $diff_offset = 0;
                    for ($j=0; $j<$k; $j++) {
                        array_pop($stack);
                    }
                }
            }
            $i++;
        }

        $answer = "";
        foreach ($stack as $item) {
            $answer .= $item;
        }
        return $answer;
    }
}